/// With LUT of only the first 100 numbers, part 2 takes ~11 ms. With LUT of the first 1000 numbers it
/// takes ~25 microseconds on the first run, ~200 ns on subsequent runs after cache is hot (on my 7800X3D).
#[inline(always)]
pub fn process_usize(num: usize, blinks: usize) -> usize {
    let mut stack = [(0, 0); 48];
    stack[0] = (blinks, num);
    let mut stack_len = 1;

    let mut result = 0;

    while stack_len > 0 {
        let (i, n) = stack[stack_len - 1];
        if i == 0 {
            result += 1;
            stack_len -= 1;
            continue;
        }
        if n < 1000 {
            result += crate::common::LUT[n][i - 1];
            stack_len -= 1;
            continue;
        }
        if let Some((a, b)) = split_usize(n) {
            stack[stack_len - 1] = (i - 1, a);
            stack[stack_len] = (i - 1, b);
            stack_len += 1;
        } else {
            stack[stack_len - 1] = (i - 1, n * 2024);
        }
    }
    result
}

/// Splits a number in half if it has an even number of digits
#[inline(always)]
pub fn split_usize(n: usize) -> Option<(usize, usize)> {
    let mag = if n < 10 {
        return None;
    } else if n < 100 {
        10
    } else if n < 1000 {
        return None;
    } else if n < 10_000 {
        100
    } else if n < 100_000 {
        return None;
    } else if n < 1_000_000 {
        1000
    } else if n < 10_000_000 {
        return None;
    } else if n < 100_000_000 {
        10_000
    } else if n < 1_000_000_000 {
        return None;
    } else if n < 10_000_000_000 {
        100_000
    } else if n < 100_000_000_000 {
        return None;
    } else if n < 1_000_000_000_000 {
        1_000_000
    } else if n < 10_000_000_000_000 {
        return None;
    } else if n < 100_000_000_000_000 {
        10_000_000
    } else if n < 1_000_000_000_000_000 {
        return None;
    } else if n < 10_000_000_000_000_000 {
        100_000_000
    } else {
        unreachable!();
    };
    Some((n / mag, n % mag))
}

